INSERT INTO `complain` VALUES (1001,103,'Water Leaking in 2nd floor tab','Admin','Logistics','There is a heavy water leaking in the 1st tab of the 2nd floor boy\'s washroom','It will be fixed by the end of this week.',NULL),(1002,104,'Regarding rude behaviour by watchman','Admin','Others','Today when i was entering in the school the watchman rudely behaved with me and asked very badly about the id-card which i just forget was in my bag','The meeting had taken on to warn the watchman about his behaviour. He will never do such kind of thing again. We had also collected the apologize letter by watchman.',NULL),(1003,104,'Regarding unhealthy food in canteen','Admin','Food Services','I ate a samosa in the canteen last day and now i am felling vomiting and concious due to \nthe samosa','We apologize for the inconvenience and the cause of eating that food or dish. We would carried out an enquiry to check the quality of the food and get on this issue. This would never happen again',NULL),(1004,104,'Rude behaviour by library staff member','Admin','Library','One of the library staff member behaves very rudely with the students and with me also \nif any student is talking or doing any other thing that not to be done in library he don\'t tell politely he spashes with all bad words on the student and insult him or her in front of the whole library ',NULL,NULL),(1005,103,'Regarding slow wifi in library\'s lab','Admin','IT Services','It becomes very difficult to work on the computers with a speed of 0.5mb per second ','It\'s will be fixed by the coming monday',NULL),(1006,103,'Regarding lack of washroom services','Admin','Logistics','There is going on construction work in 1st floor and 5th floor washroom so it is difficult to \nuse the washroom in emergency especially for girls',NULL,NULL),(1007,103,'Regarding increasing Mischeif in the classroom','Madhavi vaidya','Student Affairs','this complain is regarding increasing mischeif in the 9th classroom where the student tease each other with curse words which are really bad to listen. They fight with each other in the break time and many more are there. I request to take an action against this.','We will get to the students who create the mischeif or initialize these things and punish accordingly to set an example.',NULL),(1008,103,'Regarding to change teaching method','Admin','Faculty','I want the teachers to change there teachning method . I want them to get away from the traditional teaching method and include more of practical and critical teaching. ',NULL,NULL),(1009,102,'Regarding lack of financial aid help ','Admin','Administration','As I am from a lower middle class family i know the importance of money. I think our Administration service doesn\'t have much services for students who wants to pay the fees in installation','We have a meeting with our management office workers on this and as the result of that meeting we had increased some of the schemes for the students from EBS i.e. Economical backward section as from the college end. You can check out these new schemes on the official website of the school .',1),(1010,106,'Regarding less equipments availabe in sports room','Admin','Sports & Activities','I am writing this complain regarding the less availability of playing and sports related material in the sports room. Today when i was on my way to get the chess board and tokens to practice the chess, i found that the one i used to use was occupied by someone else. So i couldn\'t find a spare chess board and tokens','We have looked upon the issue, we also informed the sports room assistant and head to keep an attention on the availability of the equipments. Now you can check with the same.',NULL),(1011,121,'Regarding workload on students','All Teachers','Student Affairs','I Chetna Bhat class representative of 9th standard had issued this complain on behalf of my whole classroom to tell all our respected teachers to reduce the workload given to our class. We all had no time for extra studies or skill building . I request you please reduce the number of assignments and homeworks and also to increase the deadlines. thank you!',NULL,NULL),(1012,103,'Book','Madhavi vaidya','Library','book not avilable','it will be made avilable',NULL);
/*!40000 ALTER TABLE `complain` ENABLE KEYS */;
